import React from 'react';
import './header.css';

function Header() {
    return (
        <div className='header'>
            <div className="header__container">
                <div className="logo">
                    <i className="fas fa-store"></i>
                    
                </div>
            </div>
            
        </div>
    )
}

export default Header
